if ($('#vossen-youtube').length) {
    var tag = document.createElement('script');
        tag.src = "https://www.youtube.com/iframe_api";
    var firstScriptTag = document.getElementsByTagName('script')[0];
        firstScriptTag.parentNode.insertBefore(tag, firstScriptTag);
    var vosVideoId = $('#vossen-youtube').attr('youtube-video-id');
    var player;
    function onYouTubeIframeAPIReady() {
        player = new YT.Player('vossen-youtube', {
            width: $(window).width()+'0',
            height: $(window).height()+'0',
            videoId: vosVideoId,
            playerVars: { playlist: vosVideoId, autoplay : 1, controls: 0, showinfo: 0, loop: 1, },
            events: { 'onReady': onPlayerReady, 'onStateChange': onPlayerStateChange }
        });
        $(window).on('load resize', function(){
            var w = $(window).width()+0;
            var h = $(window).height()+0;
            if (w/h > 16/9){
                player.setSize(w, w/16*9);
                $('#vossen-youtube').css({'left': '0px'});
                } else {
                player.setSize(h/9*16, h);
                $('#vossen-youtube').css({'left': -($('#vossen-youtube').outerWidth()-w)/2});
            }
        });

    } 
    function onPlayerStateChange(event) {
    }
    function stopVideo() { player.stopVideo(); }
    function onPlayerReady() { 
        player.playVideo(); 
        player.mute(); 
    } 
}


  

